script: |
  super -f text -I q5463.spq | sort > q5463.out

inputs:
  - name: q5463.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL IN ( - col1 / col2 ) OR NOT col0 IN ( - col1 * + cor0.col2 + col0 * col2 + col0 );
  - name: tab2

outputs:
  - name: q5463.out
    data: |
      7	31	27
      78	59	26
      79	17	38
